import { createSlice } from '@reduxjs/toolkit'

let nextProductId = 0

const initialState = [{
    id: nextProductId++,
    name: "PS 5",
    price: "100$",
    img: "data:image/jpeg;base64,"
  },
  {
    id: nextProductId++,
    name: "PS 3",
    price: "49$",
    img: "data:image/jpeg;base64,"
  },
  {
    id: nextProductId++,
    name: "PS 4",
    price: "70$",
    img: "data:image/jpeg;base64,"
  },
  {
    id: nextProductId++,
    name: "Gamepad XBOX",
    price: "30$",
    img: "data:image/jpeg;base64,"
  },
  {
    id: nextProductId++,
    name: "XBOX series X",
    price: "330$",
    img: "data:image/jpeg;base64,"
  },
  {
    id: nextProductId++,
    name: "PC",
    price: "530$",
    img: "data:image/jpeg;base64,"
  },
]

export const itemsSlice = createSlice({
  name: 'items',
  initialState,
  reducers: {
    addItem: {
      reducer: (state, action) => {
        state.push(action.payload)
      },
      prepare: (product) => {
        return { payload: {...product, id: nextProductId++}}      
      }
    }
  },
})

export const { addItem } = itemsSlice.actions

export const selectItems = state => state.items

export default itemsSlice.reducer